import React, { useState } from 'react';
import {
  TextField,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Box,
  Typography
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { Button } from '@mui/material';
const Application3 = () => {
  const [educationData, setEducationData] = useState([
    { className: 'Inter 2nd Year', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: 'Inter 1st Year', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: '10th Class', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: '9th Class', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: '8th Class', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: '7th Class', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' },
    { className: '6th Class', yearOfStudy: '', schoolName: '', place: '', state: '', district: '' }
  ]);
  const [eapcetData, setEapcetData] = useState({
    registrationNumber: '',
    hallTicketNumber: '',
    rank: ''
  });

  const handleChange = (index, field, value) => {
    const updated = [...educationData];
    updated[index][field] = value;
    setEducationData(updated);
  };
    const navigate = useNavigate();
  const handleNext = () => {
    navigate('/ap4'); // make sure this route is defined in App.js
  };
  return (
    <Box sx={{ pt: 9, px: 6, pb: 7 }}>
      <Typography variant="h6" gutterBottom>Educational Details</Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell>Class</TableCell>
              <TableCell>Year of Study</TableCell>
              <TableCell>Name of School / College</TableCell>
              <TableCell>Place</TableCell>
              <TableCell>State</TableCell>
              <TableCell>District</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {educationData.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{row.className || '-'}</TableCell>

                <TableCell>
                  <TextField
                    size="small"
                    value={row.yearOfStudy}
                    onChange={(e) => handleChange(index, 'yearOfStudy', e.target.value)}
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    size="small"
                    value={row.schoolName}
                    onChange={(e) => handleChange(index, 'schoolName', e.target.value)}
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    size="small"
                    value={row.place}
                    onChange={(e) => handleChange(index, 'place', e.target.value)}
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    size="small"
                    value={row.state}
                    onChange={(e) => handleChange(index, 'state', e.target.value)}
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    size="small"
                    value={row.district}
                    onChange={(e) => handleChange(index, 'district', e.target.value)}
                  />
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 3, my: 3 }}>
  <TextField
    label="TG EAPCET Registration Number"
    value={eapcetData.registrationNumber}
    onChange={(e) => setEapcetData({ ...eapcetData, registrationNumber: e.target.value })}
    size="small"
    fullWidth
  />
  <TextField
    label="TG EAPCET Hall Ticket Number"
    value={eapcetData.hallTicketNumber}
    onChange={(e) => setEapcetData({ ...eapcetData, hallTicketNumber: e.target.value })}
    size="small"
    fullWidth
  />
  <TextField
    label="TG EAPCET Rank"
    value={eapcetData.rank}
    onChange={(e) => setEapcetData({ ...eapcetData, rank: e.target.value })}
    size="small"
    fullWidth
  />
</Box>
      <Box sx={{ mt: 3, textAlign: 'right' }}>
        <Button variant="contained" onClick={handleNext}>Next</Button>
      </Box>

    </Box>
  );
};

export default Application3;
